import { Typography ,TextField} from '@mui/material';
import React from 'react';
import styled from 'styled-components';


const FullScreenContainer = styled('div')`
  height: 100vh;
  width: 100vw;
  display: flex;
  justify-content: center;
  align-items: center;
  background-color: #eeeeee; /* Optional: Set a background color */
`;

const StyledPaper = styled('div')`
  display: flex;
  flex-direction: column;
  align-items: center;
  padding: 32px 64px;
  max-width: 500px;
  width: 28.5rem;
  background-color: white;
  border-radius: 16px;
`;

const StyledTypography = styled('div')`
  display: flex;
  width:328px;
  height:33px;
  justify-content: center;
  font-weight: 800;
  line-height: 1.2;
  font-size: 1.75rem;
  font-family: Baikal, Inter, sans-serif;
  letter-spacing: -0.025em;
  text-align: center;
  margin: 0.5rem 0px 1.25rem;
`;
const StyledForm=styled('div')`

width:328px;
margin:2px;
 
  
`
const StyledInput= styled('div')`
 text-align:left;
 width:inherit;


`
const StyledText=styled('div')`
color: rgb(58, 58, 58);
    font-size: 0.75rem;
    margin-bottom: 0.3rem;
    display: inline-block;
    font-weight:500;
      letter-spacing: -0.01em;

`
const StyledTextField=styled(TextField)`


padding: 0px 1rem;
height: 3rem;
width: 100%;
display: flex;
-webkit-box-align: center;
align-items: center;
font-style: inherit;
font-variant: inherit;
font-weight: inherit;
font-stretch: inherit;
line-height: inherit;
font-family: inherit;
font-optical-sizing: inherit;
font-kerning: inherit;
font-feature-settings: inherit;
font-variation-settings: inherit;
font-size: 1rem;
color: rgb(12, 12, 12);
border-radius: 8px;
border-style: solid;
border-color: rgb(206, 206, 206);
border-width: 1px;
background: rgb(255, 255, 255);
caret-color: rgb(107, 107, 107);
outline: none;
transition: border-color 300ms cubic-bezier(0.4, 0, 0.2, 1) 0ms;

}
`
export const Login = () => {
  return (
    <FullScreenContainer>
      <StyledPaper>
        <StyledTypography>
          Log in
        </StyledTypography>
       <StyledForm>
          <StyledInput>
            <StyledText>
              Email or Mobile Number
            </StyledText>
            <StyledTextField
              
             variant='outlined'
               placeholder="Enter your password" 
            />
        
          </StyledInput>
       </StyledForm>
      </StyledPaper>
    </FullScreenContainer>
  );
};
